import React from 'react';
import ArrowUpwardIcon from '@material-ui/icons/ArrowUpward';
import './backtotop.css'

function BackToTop() {


    return (
      <div>
        <button id="backToTopButton">
            <ArrowUpwardIcon/>
        </button>
      </div>
    );
  }
  
  export default BackToTop;
